import React from 'react'
import { Redirect } from 'react-router-dom'
import { getTokenClient } from './token';
import { Grid } from '@material-ui/core';
import TitleBar from '../subComponent/TitleBar';

class Main extends React.Component{
    render(){
        if(getTokenClient()){
            return(
                <Grid container className="containerDetail">

                    <Grid item sm={12} xs={12} style={{maxHeight:50}}>
                        
                        <TitleBar
                            title={'Bank Dashboard'}
                        />

                    </Grid>
                    <Grid
                        item
                        sm={12} xs={12}
                        style={{padding:'40%', marginBottom:20, boxShadow:'0px -3px 25px rgba(99,167,181,0.24)', WebkitBoxShadow:'0px -3px 25px rgba(99,167,181,0.24)', borderRadius:'15px'}}                  
                    >
                    </Grid>
                </Grid>
            )
        }
        if(!getTokenClient()){
            return (
                <Redirect to='/login' />
            )    
        }
       
    }
}

export default Main;
